import { AppartList } from "../../Datas/AppartList";



function display () {

    return (
        <ul className='appart-list'>
				{AppartList.map(({ id,title ,cover, picture, description, host, rating, location, equipments, tag }) => 
					(
						<div key={id}>
							<PlantItem
                                title={title}
								cover={cover}
								picture = {picture}
								description={description}
								host={host}
                                rating={rating}
                                location={location}
                                equipments={equipments}
								tag={tag}
							/>
                         </div>
                    ) )
                }
         </ul> 
    )
}
